import React from 'react';
import ArrowBackIosIcon from '@mui/icons-material/ArrowBackIos';

const Savesegment = () => {
  return (
    <>
        <div>
            <div className='header'>
                <div><ArrowBackIosIcon/></div>
                <div className='title1'>view Audience</div>
            </div>
        </div>
    </>
  )
}

export default Savesegment
